import os
import gtk
import mime
import thumbnail

def get_icon_path(name):
    icon_theme = gtk.icon_theme_get_default()
    icon_info = icon_theme.lookup_icon(name, 48, 0)
    if icon_info != None:
        return icon_info.get_filename()

def get_icon_path_for_mime_type(type):
    de_slashed_str = type.replace('/', '-')
    return get_icon_path(de_slashed_str)

def get_icon_path_for_file(file):
    icon_path = None
    if os.path.isdir(file.path):
        icon_path = get_icon_path('folder')
    elif is_thumbnailable(file):
        thumbnail_path = thumbnail.get_thumbnail_path(file)
        if thumbnail_path != None:
            icon_path = file.path

    if icon_path == None:
        mime_type = mime.get_mime_type(file.path)
        icon_path = get_icon_path_for_mime_type('gnome-mime-' + mime_type)
        if icon_path == None:
            icon_path = get_icon_path_for_mime_type(mime_type)

    # have a default
    if icon_path == None:
        icon_path = get_icon_path('unknown')

    return icon_path
        


def is_thumbnailable(file):
    # fixme: check what can be thumbnailed
    # fixme: check mime type
    return file.extension in ['.bmp', '.png', '.gif', '.jpg', '.jpeg', '.pdf']




